import React,{useState,useEffect,useMemo} from 'react';
import NavbarAdmin from './adminNav';
import { DataGrid } from '@mui/x-data-grid';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
import { CircularProgress, Typography } from '@mui/material';
function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }
  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];
const WatchOrder = () => {
    return ( 
        <>
        <NavbarAdmin/>
        <TableContainer component={Paper} sx={{
            position:"absolute" ,
            top:"100px"
    }}>
      <Typography variant="h3"> ORDERS</Typography>
      <Table sx={{ minWidth: 700 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell align="right">OrderId</TableCell>
            <TableCell>CName</TableCell>
            <TableCell align="right">Cphone</TableCell>
            <TableCell align="right">Clocation</TableCell>
            <TableCell align="right">productname</TableCell>
            <TableCell align="right">Amount</TableCell>
            <TableCell align="right">price</TableCell>
            <TableCell align="right">Sphone</TableCell>
            <TableCell align="right">Location</TableCell>
            <TableCell align="right">State</TableCell>
            
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                01
              </TableCell>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">O450</TableCell>
              <TableCell align="right">Oromia nkjdlfngb kjcbg kljxfg kjxbdgf</TableCell>
              <TableCell align="right">Piasa</TableCell>
              <TableCell align="right">Ednamall flour4</TableCell>
              <TableCell align="right"> <Button variant="contained">Not Deliverd</Button> </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    {/* <CircularProgress/> */}
        </>
     );
}
 
export default WatchOrder;
